MongoDB - aggregate match field from the previously matched document<p>I have a collection with following schema -</p>
<pre><code>const ContentSchema = new Schema({
    label: {
        type: String
    },
    itemId: {
        type: Schema.ObjectId,
        refPath: 'onModel'
    },
    formId: {
        type: Schema.ObjectId,
        refPath: 'onModel'
    },
    value: {
        type: Schema.Types.Mixed,
        index: &quot;text&quot;
    },
}, { timestamps: true, versionKey: false });
</code></pre>
<p>Here are some example documents the collection may have -</p>
<pre><code>{
  _id: ObjectId('647b1538c29a553ad6e8f316'),
  label: &quot;Name&quot;,
  itemId: ObjectId('647b1538c29a553ad6e8f313'),
  formId: ObjectId('647b1538c29a553ad6e8f913'),
  value: &quot;ABC&quot;
},
{
  _id: ObjectId('647b1538c29a553ad6e8f416'),
  label: &quot;Email&quot;,
  itemId: ObjectId('647b1538c29a553ad6e8f313'),
  formId: ObjectId('647b1538c29a553ad6e8f913'),
  value: &quot;def@mail.com&quot;
},
{
  _id: ObjectId('647b1538c29a553ad6e8f516'),
  label: &quot;Name&quot;,
  itemId: ObjectId('647b1538c29a553ad6e8f320'),
  formId: ObjectId('647b1538c29a553ad6e8f913'),
  value: &quot;MNO&quot;
},
{
  _id: ObjectId('647b1538c29a553ad6e8f616'),
  label: &quot;Email&quot;,
  itemId: ObjectId('647b1538c29a553ad6e8f320'),
  formId: ObjectId('647b1538c29a553ad6e8f913'),
  value: &quot;xyz@mail.com&quot;
}
</code></pre>
<p>Now, I need to perform a query to search &quot;ABC&quot; from the collection with <code>formId</code> - <code>ObjectId('647b1538c29a553ad6e8f913')</code>.</p>
<p>Here is the code to do that -</p>
<pre><code>return await ContentModel.aggregate([
{
    $match: {
        $text: { $search: text },
        formId: new mongoose.Types.ObjectId(formId)
    }
}]
</code></pre>
<p>The above code is absolutely working fine and returns the document -</p>
<pre><code>{
    _id: ObjectId('647b1538c29a553ad6e8f316'),
    label: &quot;Name&quot;,
    itemId: ObjectId('647b1538c29a553ad6e8f313'),
    formId: ObjectId('647b1538c29a553ad6e8f913'),
    value: &quot;ABC&quot;
}
</code></pre>
<p>But I need more records within the same aggregation. Now I need to find out other documents from the document with itemId - <code>ObjectId('647b1538c29a553ad6e8f313')</code>.</p>
<p>So that the aggregation should now return 2 documents -</p>
<pre><code>    {
      _id: ObjectId('647b1538c29a553ad6e8f316'),
      label: &quot;Name&quot;,
      itemId: ObjectId('647b1538c29a553ad6e8f313'),
      formId: ObjectId('647b1538c29a553ad6e8f913'),
      value: &quot;ABC&quot;
    },
    {
      _id: ObjectId('647b1538c29a553ad6e8f416'),
      label: &quot;Email&quot;,
      itemId: ObjectId('647b1538c29a553ad6e8f313'),
      formId: ObjectId('647b1538c29a553ad6e8f913'),
      value: &quot;def@mail.com&quot;
    }
</code></pre>
<p>I am trying with following query which does not work -</p>
<pre><code>return await ContentModel.aggregate([
{
    $match: {
        $text: { $search: text },
        formId: new mongoose.Types.ObjectId(formId)
    }
},
{
    $match: { itemId: &quot;$itemId&quot; }
}]
</code></pre>

