MongooseError: Model.findOneAndUpdate() no longer accepts a callback<p>I've encountered a problem while setting up mongoose.</p>
<p>My code</p>
<pre><code>export const getOne = (req, res) =&gt; {
    try {
        const postId = req.params.id

        PostModel.findOneAndUpdate(
            {
                _id: postId,
            },
            {
                $inc: { viewsCount: 1 },
            },
            {
                returnDocument: 'after',
            },
            (err, doc) =&gt; {
                if (err) {
                    console.log(error)
                    return res.status(500).json({ message: &quot;cant return post&quot; })
                }

                if (!doc) {
                    return res.status(404).json({
                        message: &quot;post not found&quot;
                    })
                }

                res.json(doc)
            },
        )
    } catch (error) {
        console.log(error)
        res.status(500).json({ message: &quot;cant retunr post&quot; })
    }
}
</code></pre>
