  &quot;PersoOptins&quot;: 1
}
</code></pre>
<p>Data on destination looks like this:</p>
<pre><code>{
    &quot;_id&quot; : NumberLong(1)
    &quot;Member&quot; : {
        &quot;AccountState&quot; : NumberInt(1),
        &quot;BirthDate&quot; : ISODate(&quot;1986-06-05T22:00:00.000+0000&quot;),
        &quot;CreationDate&quot; : ISODate(&quot;2001-01-30T23:56:00.000+0000&quot;),
        &quot;Culture&quot; : &quot;fr-FR&quot;,
        &quot;Email&quot; : &quot;test@hotmail.com&quot;,
        &quot;FirstName&quot; : &quot;Lorem&quot;,
        &quot;Gender&quot; : NumberInt(1),
        &quot;GodFatherId&quot; : NumberLong(657),
        &quot;LastName&quot; : &quot;Ipsum&quot;,
        &quot;ModificationDate&quot; : ISODate(&quot;2022-04-20T15:44:00.000+0000&quot;),
        &quot;SchemaVersion&quot; : NumberInt(1),
        &quot;SiteId&quot; : NumberInt(1)
    }
}
</code></pre>
<p>I want to add source property &quot;PersoOptins&quot; to all records on destination that doesn't contain it. I'm merging on _id field. This is my pipeline:</p>
<pre><code>[
  {
    $fill:
      {
        output: {
          OptinPerso: {
            value: 0,
          },
        },
      },
  },
  {
    $lookup:
      {
        from: &quot;RecipientAggregate&quot;,
        localField: &quot;_id&quot;,
        foreignField: &quot;_id&quot;,
        pipeline: [
          {
            $match: {
              &quot;Member.OptinPerso&quot;: {
                $exists: false,
              },
            },
          },
        ],
        as: &quot;Result&quot;,
      },
  },
  {
    $unwind:
      {
        path: &quot;$Result&quot;,
        preserveNullAndEmptyArrays: false,
      },
  },
  {
    $project:
      {
        _id: 1,
        &quot;Member.OptinPerso&quot;: &quot;$PersoOptins&quot;,
      },
