  {
    $merge:
      {
        into: &quot;RecipientAggregate&quot;,
        on: &quot;_id&quot;,
        whenMatched: &quot;merge&quot;,
      },
  },
]
</code></pre>
<p>However, I'm getting error <code>Cannot find index to verify that join fields will be unique</code> on the merge stage, and I can't find the problem, as _id field used for joining is the PK on both collections. The only difference is that source _id field is a regular index, while _id on destination is a clustered one. Any hint?</p>

