Mongo db query optimization<p>I am using mongo db to store notifications, a <code>cron</code> job runs every midnight to pick old notification and delete them.</p>
<p>The deletion policy has a logic to retain the oldest notification of each combination of  <code>&quot;sourceObjectIdentifier&quot;</code> and <code>&quot;notificationType&quot;</code>. The aggregated output of query 1 is given to query 2 to form the deletion query.</p>
<p><strong>query 1</strong> -</p>
<pre class="lang-js prettyprint-override"><code>db.persistentEvent.aggregate([
  {
    &quot;$match&quot;: {
      &quot;notificationClass&quot;: {&quot;$eq&quot;: &quot;category&quot;}
    }
  },
  {
    &quot;$group&quot;: {
      &quot;_id&quot;: [
        {&quot;sourceObjectIdentifier&quot;: &quot;$sourceObjectIdentifier&quot;},
        {&quot;notificationType&quot;: &quot;$notificationType&quot;}
      ],
      &quot;notificationId&quot;: {&quot;$last&quot;: &quot;$notificationId&quot;},
      &quot;notificationClass&quot;: {&quot;$last&quot;: &quot;$notificationClass&quot;}
    }
  },
  {
    &quot;$project&quot;: {
      &quot;_id&quot;: 0,
      &quot;notificationId&quot;: 1,
      &quot;notificationClass&quot;: 1
    }
  },
  {
    &quot;$sort&quot;: {
      &quot;sourceObjectIdentifier&quot;: 1,
      &quot;notificationType&quot;: 1,
      &quot;creationTime&quot;: -1
    }
  }
])
</code></pre>
<p><strong>query 2</strong> -</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;deliveryTime&quot;: {
    &quot;$gt&quot;: &quot;$datefrom&quot;
  },
  &quot;creationTime&quot;: {
    &quot;$lt&quot;: &quot;dateto&quot;
  },
  &quot;notificationId&quot;: {
    &quot;$nin&quot;: [query_1_output]
  }
}
</code></pre>
<p>This deletion logic works fine if the number of notifications in the collection is less but it starts to take a long time when the number of notifications are in range 200k or above.</p>
<p>Can someone please suggest how can I improve the query and can the query 1 and 2 be executed together?</p>

