How to Implement Global Filters for Soft Delete in MongoDB Integration to Exclude Deleted Records from Queries?<p>Is there a way to implement global filters using the <a href="https://chillicream.com/docs/hotchocolate/v12/integrations/mongodb" rel="nofollow noreferrer">MongoDb integration for HotChocolate</a> when all my types allow soft delete? Soft delete means marking the record to be deleted by setting the IsDeleted field to true, and then completely removing those records after a few weeks.</p>
<p>e.g.</p>
<pre><code>public interface ISoftDelete
{
    bool IsDeleted { get; set; }
}

public class ExampleModel : ISoftDelete
{
    public string Id { get; set; }
    public string Name { get; set; }

    [GraphQLIgnore]
    public bool IsDeleted { get; set; }
}
</code></pre>
<p>While all my types have the IsDeleted flag, it is ignored in the GraphQL schema. My question is, how can I set a global filter for all Find and Aggregation operations so that all queries made to MongoDB include the filter IsDeleted = false?</p>
<p>This way, customers will never see deleted records, and developers wont need to manually add that filter to each query anymore.</p>

